    false,nt"url": null,nt"notes": "1922 Digitized Shoreline for Breton Island,
    Louisiana (Geographic, NAD83) consists of vector shoreline data that were derived
    from a set of National Ocean Service (NOS) raster shoreline maps (often called T-sheet
    or TP-sheet maps) created for Breton Island in 1922. In 2002, NOAA published digitized
    shorelines for T-sheet (T-3920), which were subsequently edited by USGS staff for
    input into the Digital Shoreline Analysis System (DSAS) Version 4.0, where area
    and shoreline change analyses could be conducted.",nt"license_title": null,nt"extras":
